sprites.onOverlap(SpriteKind.Player, SpriteKind.lettuce, function (sprite, otherSprite) {
    otherSprite.setVelocity(0, 0)
    otherSprite.setPosition(100, 80 - 2 * ingOnPlate)
    numLettuce += 1
    ingOnPlate += 1
    SpriteOnePlate.push(otherSprite)
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.burger, function (sprite, otherSprite) {
    otherSprite.setVelocity(0, 0)
    otherSprite.setPosition(100, 80 - 2 * ingOnPlate)
    numBurger += 1
    ingOnPlate += 1
    SpriteOnePlate.push(otherSprite)
})
function food () {
    randNum = Math.randomRange(0, 0)
    if (randNum == 0) {
        chef.say("Burger!")
    } else if (randNum == 1) {
        chef.say("Pancakes!")
    }
}
sprites.onOverlap(SpriteKind.Player, SpriteKind.pancae, function (sprite, otherSprite) {
    otherSprite.setVelocity(0, 0)
    otherSprite.setPosition(100, 80 - 2 * ingOnPlate)
    numPancakes += 1
    ingOnPlate += 1
    SpriteOnePlate.push(otherSprite)
})
controller.B.onEvent(ControllerButtonEvent.Pressed, function () {
    ClearPlate()
})
